response.activities:
Профессиональная сфера:
- взаимоотношения в паре (любовные, интимные, семейные);
- саморазвитие, профессиональный и личностный рост, повышение самооценки;
- одиночество, замкнутость, тревога;
- социофобия и др. фобии;
- отсутствие смысла в жизни, депрессия;
- панические атаки, навязчивые состояния (ОКР), психосоматические расстройства;
- потеря близких;
- заедание проблем, пищевая зависимость.

Главное, что я вижу за время своей более, чем 14-ти летней практики — все наши взлеты зависят от нас самих, а большинство жизненных неудач на самом деле разрешимы. Необходимо лишь стать ответственным за свою жизнь и начать действовать. Ну а я вам в этом с удовольствием помогу!
